import React from 'react';
import Testimonial from '../components/Testimonial';
import './Home.css';

function Home() {
  const testimonials = [
    {
      quote: 'Great work! Delivered on time and exceeded expectations.',
      author: 'John Doe',
      role: 'CEO, Company ABC',
    },
    {
      quote: 'A pleasure to work with, very professional.',
      author: 'Jane Smith',
      role: 'Project Manager, Company XYZ',
    },
  ];

  return (
    <div className="home">
      <h1>Welcome to My Portfolio</h1>
      <p>This is where you can showcase your best work.</p>
      <div className="testimonials">
        {testimonials.map((testimonial, index) => (
          <Testimonial
            key={index}
            quote={testimonial.quote}
            author={testimonial.author}
            role={testimonial.role}
          />
        ))}
      </div>
    </div>
  );
}

export default Home;
